import React, { Fragment, Component } from "react";
import { installApp } from "/lib/api";
// import { Modal, List } from "antd-mobile";
import cx from "classnames";
// import { navigateTo } from 'src/router/navigateTo';
import AddLoad from "./AddLoad";
import styled from "styled-components";
import * as Antd from "antd";
import { filter } from "lodash";
const AddWrap = styled.div`
   {
    .dialogContent {
      padding-right: 0;
    }

    .projectList {
      overflow-y: auto;
      max-height: 300px;
      margin-bottom: 20px;
    }

    .splitLine {
      width: 372px;
      border-top: 1px solid #ccc;
      margin: 24px 0;
    }

    .projectList.scrollBar {
      padding-right: 20px;
    }

    .projectItem {
      font-size: 15px;
      line-height: 50px;
      width: 100%;
      height: 50px;
      margin-bottom: 20px;
      padding: 0 10px;
      border: 1px solid #ccc;
      border-radius: 4px;
      align-items: center;
      box-sizing: border-box;
    }

    .projectItem .companyName {
      overflow: hidden;
      min-width: 0;
      white-space: nowrap;
      text-overflow: ellipsis;
      color: #333;
    }

    .projectItem:hover {
      border-color: currentColor;
    }

    .projectItem:last-child {
      margin: 0;
    }

    .projectItem:not(:hover) .icon-arrow-right-border {
      color: #999 !important;
    }
  }
`;
class AddDialog extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isInstallApp: false,
    };
  }

  installAppFn = (projectId, libraryId) => {
    const { isMobile } = this.props;
    this.setState({
      isInstallApp: true,
    });
    installApp({
      projectId,
      libraryId,
    }).then(
      (res) => {
        setTimeout(() => {
          // isMobile ? navigateTo(`/mobile/app/${res}`) : navigateTo(`/app/${res}`);
        }, 3000);
      },
      () => {
        this.props.onCancel();
      }
    );
  };

  renderDiaLog = () => {
    let { projects = [] } = this.props;
    projects = projects.filter((item) => !item.cannotCreateApp);
    const length = projects.length;
    return (
      <div className="dialogContent">
        <ul className="projectList">
          {projects.map((item, i) => {
            let type = ((length - 1 - i) % 6) + 1;
            let projectClassName = "icon-chatnetwork-type" + type;
            return (
              <li
                className="projectItem flexRow pointer ThemeColor3 Hand false"
                key={item.projectId}
                onClick={() => {
                  this.installAppFn(item.projectId, this.props.libraryId);
                }}
              >
                <span className={cx("Font18 projectIcon", projectClassName)} />
                <span className="flex pLeft12 companyName">
                  {item.companyName}
                </span>
                <span className="icon-arrow-right-border ThemeColor3" />
              </li>
            );
          })}
        </ul>
      </div>
    );
  };

  render() {
    let { onCancel, visible, projectId, isMobile, projects = [] } = this.props;
    const { isInstallApp } = this.state;
    projects = projects.filter((item) => !item.cannotCreateApp);
    const { length } = projects;
    return !!projectId || isInstallApp ? (
      <AddLoad visible={visible} />
    ) : (
      <Fragment>
        {isMobile ? (
          2132131
          // <Modal
          //   popup
          //   visible={visible}
          //   onClose={onCancel}
          //   animationType="slide-up"
          // >
          //   <List
          //     renderHeader={() => <div>安装到</div>}
          //     style={{ maxHeight: 390 }}
          //   >
          //     {projects.map((item, index) => (
          //       <List.Item
          //         key={item.projectId}
          //         thumb={
          //           <i
          //             className={`Font20 icon icon-chatnetwork-type${
          //               ((length - 1 - index) % 6) + 1
          //             }`}
          //           />
          //         }
          //         onClick={() => {
          //           this.installAppFn(item.projectId, this.props.libraryId);
          //         }}
          //       >
          //         {item.companyName}
          //       </List.Item>
          //     ))}
          //   </List>
          // </Modal>
        ) : (
          <Antd.Modal
            visible={visible}
            className="AddDialog"
            title="安装到"
            footer={null}
            onCancel={onCancel}
          >
            <AddWrap className="AddWrap">{this.renderDiaLog()}</AddWrap>
          </Antd.Modal>
        )}
      </Fragment>
    );
  }
}

export default AddDialog;
